var Tests;(function(){describe("Flag Operations",function(){var r,n,u,t,i;beforeEach(function(){module("app")}),beforeEach(function(){inject(function(t,f){r=t,u=f,n=r.getCpu(),i=n.rP})}),describe("CLD - Clear Decimal Flag",function(){beforeEach(function(){t=new Emulator.ClearDecimalSingle}),describe("given decimal flag not set",function(){beforeEach(function(){t.execute(n)}),it("then should not affect registers",function(){expect(n.rP).toBe(i)})}),describe("given decimal flag set",function(){beforeEach(function(){n.setFlag(Constants.ProcessorStatus.DecimalFlagSet,!0),t.execute(n)}),it("then should set registers back to original",function(){expect(n.rP).toBe(i)})})}),describe("SED - Set Decimal Flag",function(){beforeEach(function(){t=new Emulator.SetDecimalSingle}),describe("given decimal flag not set",function(){beforeEach(function(){t.execute(n)}),it("then should set decimal flag",function(){expect(n.checkFlag(Constants.ProcessorStatus.DecimalFlagSet)).toBe(!0)})}),describe("given decimal flag set",function(){beforeEach(function(){n.setFlag(Constants.ProcessorStatus.DecimalFlagSet,!0),i=n.rP,t.execute(n)}),it("then should not affect registers",function(){expect(n.rP).toBe(i)})})}),describe("CLC - Clear Carry Flag",function(){beforeEach(function(){t=new Emulator.ClearCarrySingle}),describe("given carry flag not set",function(){beforeEach(function(){t.execute(n)}),it("then should not affect registers",function(){expect(n.rP).toBe(i)})}),describe("given carry flag set",function(){beforeEach(function(){n.setFlag(Constants.ProcessorStatus.CarryFlagSet,!0),t.execute(n)}),it("then should set registers back to original",function(){expect(n.rP).toBe(i)})})}),describe("SEC - Set Carry Flag",function(){beforeEach(function(){t=new Emulator.SetCarrySingle}),describe("given carry flag not set",function(){beforeEach(function(){t.execute(n)}),it("then should set carry flag",function(){expect(n.checkFlag(Constants.ProcessorStatus.CarryFlagSet)).toBe(!0)})}),describe("given carry flag set",function(){beforeEach(function(){n.setFlag(Constants.ProcessorStatus.CarryFlagSet,!0),i=n.rP,t.execute(n)}),it("then should not affect registers",function(){expect(n.rP).toBe(i)})})}),describe("CLC - Clear Overflow Flag",function(){beforeEach(function(){t=new Emulator.ClearOverflowSingle}),describe("given overflow flag not set",function(){beforeEach(function(){t.execute(n)}),it("then should not affect registers",function(){expect(n.rP).toBe(i)})}),describe("given overflow flag set",function(){beforeEach(function(){n.setFlag(Constants.ProcessorStatus.OverflowFlagSet,!0),t.execute(n)}),it("then should set registers back to original",function(){expect(n.rP).toBe(i)})})})})})(Tests||(Tests={}))